import React from "react";
import './footer.css'
import {Container, Row, Col, ListGroup, ListGroupIttem} from 'reactstrap'
import {Link} from 'react-router-dom'

import logo from '../../assets/images/logo.png'

const quick__links =[
    {
        path:'/home',
        display: 'Home'
    },
    {
        path:'/about',
        display: 'About'
    },
    {
        path:'/tour',
        display: 'Tours'
    },
]

const Footer = () => {
    return <footer className="footer">
        <Container>
            <Row>
                <Col lg='3'></Col>
            </Row>
        </Container>
    </footer>
}

export default Footer
